    btnScan() { 

        this.setState({
            BLockedBUttonScan : true,
            BLockedBUttonSave : true , 
            BLockedBUttonDelete : true
        })

         
        var scanner = new Omnix.ScannerEx({ "scanName": $("#txtScanningName").val() });

        var scanType = $("input#feeder").is(':checked') ? ($("input#duplex").is(':checked') ? 3 : 2) : 1;
        // console.log("scanType: " + scanType);
        //   console.log("Device ID: " + $("#lstDeviceID").val());
        var port;
        if ($("input#rtImageTransfer").is(':checked')) {
            //console.log("calling Enable EnableRealtimeTransfer");
            port = JSON.parse(scanner.EnableRealtimeTransfer()).EnableRealtimeTransferResult.TransferSocketPort;
        }

        //var scan = JSON.parse(scanner.scan($("#lstDeviceID").val(), $("#sDPI").val(), $("#sImageType").val(), $("#sColorType").val(), scanType, $("#cbCrop").is(':checked'), port, function (event) {
        var scan = JSON.parse(scanner.scan($("#lstDeviceID").val(), $("#sDPI").val(), $("#sImageType").val(), $("#sColorType").val(), scanType, $("#sCropMode").val(), "[\"150, 75, 400, 80\",\"128, 670, 500, 175\",\"128, 330, 500, 175\"]", port, function (event) {
           
            if (event.type == "open") {
                //   console.log('Socket Status:: Opened.');
            }
            if (event.type == "close") {
                //  console.log('Socket Status:: Closed.');
            }
            if (event.type == "error") {
                //   console.log('Socket Status:: Error was reported.');
            }
            if (event.type == "message") {
                //  console.log(event.data);
                if (event.data == "request:scanname") {
                    scanner.sendMessage($("#txtScanningName").val());
                } else if (event.data.substring(0, 6) == "error:") {
                    alert(event.data.substring(6, event.data.length));
                    scanner.disconnectSocket();
                } else if (event.data == "status:" + $("#txtScanningName").val() + ":completed") {
                    scanner.disconnectSocket();
                } else /*if (event.data == "image:")//*/ {
                    var totalImages = parseInt($("#total_images").val()) + 1;
                    $("#total_images").val(totalImages);
                    $("#current_image_counter").val(totalImages);
                    CurrentImageCounter = totalImages;
                    $('#lstImagesNames').append($("<option/>").attr("value", event.data).text(event.data));
                    ScannedImage.src = 'http://localhost:9001/Scanner/Images/' + $("#txtScanningName").val() + '/' + event.data;
                }
            }
        })).ScanResult;


        if (scan.StatusCode == 0) {
            
            this.GetScanningNameImages();
            $("#ScannedImage").attr("src", Omnix.ScannerServiceURL + '/Scanner/Images/' + $("#txtScanningName").val() + '/' + lstImagesNames.options[lstImagesNames.options.length - 1].value);
            $("#current_image_counter").val($("#total_images").val());
            this.setState({
                CurrentImageCounter: $("#current_image_counter").val()
            })

            $("#lstImagesNames").prop('selectedIndex', $("#total_images").val() - 1);
 
        }
        else {
            debugger;
            if(scan.StatusMessage == "Device not found.")
            {
                alert("        ");
            }else{
                alert(scan.StatusMessage);
            }
          
        }


       
        
    }

    btnDeleteSelectedImage() {
        var scanner = new Omnix.ScannerEx({ "scanName": $("#txtScanningName").val() });

        if (scanner.deleteScannedImage($("#lstImagesNames").val())) {
            if (current_image_counter.value == total_images.value) {
                current_image_counter.value = parseInt(current_image_counter.value) - parseInt(1);
            }
            if (current_image_counter.value >= 1) {

                lstImagesNames.remove(lstImagesNames.selectedIndex);
                total_images.value = parseInt(lstImagesNames.options.length);
                lstImagesNames.selectedIndex = parseInt(current_image_counter.value) - parseInt(1);
                ScannedImage.src = 'http://localhost:9001/Scanner/Images/' + $("#txtScanningName").val() + '/' + lstImagesNames.options[lstImagesNames.selectedIndex].value;

            }
            else {
                lstImagesNames.remove(lstImagesNames.selectedIndex);
                total_images.value = parseInt(0);
                ScannedImage.src = null;
            }

        }
        else {
            alert('Not Deleted');
        }
        setTimeout(() => {
            this.GetScanningNameImages();
        }, 2000);

    }

